import React from 'react';
import '../css/card.css'; // Import the CSS file

const ProfileHoverCard = () => {
  return (
    <div className="image-area">
      <div className="img-wrapper">
        <img
          src="https://images.pexels.com/photos/1220757/pexels-photo-1220757.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
          alt="David James"
        />
        <h2>David James</h2>
        <ul>
          <li><a href="https://github.com/atuljustano" target="_blank" rel="noopener noreferrer"><i className="fab fa-github"></i></a></li>
          <li><a href="https://www.instagram.com/atulkprajapati2000/" target="_blank" rel="noopener noreferrer"><i className="fab fa-instagram"></i></a></li>
          <li><a href="https://twitter.com/atuljustano" target="_blank" rel="noopener noreferrer"><i className="fab fa-twitter"></i></a></li>
          <li><a href="https://www.youtube.com/channel/UCf-KfxuY8PZBSD_8RW2nYsw" target="_blank" rel="noopener noreferrer"><i className="fab fa-youtube"></i></a></li>
        </ul>
      </div>
    </div>
  );
};

export default ProfileHoverCard;
